import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import classes from './create.css';
import { Link } from 'react-router-dom';
import axios from 'axios';

export class Navbar extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            tokenId: window.localStorage.getItem("token"),
            userDetails: []

        }
    }

    componentDidMount = (e) => {

        axios.get("http://127.0.0.1:5000/get-user-token", {
            headers: {
                Authorization: "Bearer " + this.state.tokenId,
                'Content-Type': 'application/json'
            }
        })
            .then(response => {
                console.log(response.data)
                this.setState({
                    userDetails: response.data
                })
            })
            .catch((err) => alert(err))
    }

    render() {
        return (
            <div>
                <div className={classes.root}>
                    <AppBar position="static" >
                        <Toolbar>
                            <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
                                <MenuIcon />
                            </IconButton>
                            <Typography variant="h3" className={classes.title}>
                                Tweetter
                             </Typography>
                            <Link class="ml-5 text-dark" to='/UserAllDetails'><Button color="inherit">UserAllDetails</Button></Link>
                            {/* <Link class="ml-5 text-dark" to='/Usersignin'> <Button color="inherit">CreateUser</Button></Link> */}
                            <Link class="ml-5 text-dark" to="/ShowAlltwite"><Button color="inherit">ShowAlltwitte</Button></Link>
                            <Link class="ml-5 text-dark" to="/CreateTwite"><Button color="inherit">Create twitte</Button></Link>
                            <Link class="ml-5 text-dark" to="/ShowAllUsers"><Button color="inherit">ShowAllUsers</Button></Link>

                            <div className="ml-5 mt-1 h4">{this.state.userDetails.name}</div>
                            {/* <img src={`http://127.0.0.1:5000/${this.state.userDetails.postImageLink}`} style={{ width: "50px", height: "50px" }} className="ml-5 rounded-circle" alt = "image"></img> */}

                        </Toolbar>
                    </AppBar>
                </div>
            </div>
        )
    }
}

export default Navbar
